import React from "react";
import { withBaseIcon } from "react-icons-kit";

import { ic_language } from "react-icons-kit/md/ic_language";

const Icon = withBaseIcon({ size: 24 });

export const iconLanguage = () => <Icon icon={ic_language} />;
